//液晶数据结构
struct lcd_rgb565{
	u16 unit;
};
struct lcd_line{
struct lcd_rgb565 part[128];
};
struct lcd_all_line{
struct lcd_line sec[128];
};
struct lcd_all_line *plcd;
//END
//液晶显示
void display(struct lcd_all_line *p)
       {
				 u8 x=0,y=0;
				 u16 temp=0;
				 	Lcd_SetXY(0,0);
			for(x=0;x<128;x++)//行
				 {
					 
						Lcd_SetXY(0,x);	
			   for(y=0;y<128;y++)//列
			      {		 				
				 temp=p->sec[x].part[y].unit;
	       Lcd_WriteData_16Bit(temp);          
			      } 
        }
			    }
int main(void)
{
const unsigned char *p[7]={gImage_1,gImage_2,gImage_3,gImage_4,gImage_5,gImage_6,gImage_7};
u8 i;
    HAL_Init();                     //初始化HAL库   
    Stm32_Clock_Init(360,25,2,180);   //设置时钟,180Mhz
    delay_init(180);                //初始化延时函数
    LED_Init();                     //初始化LED  
	Lcd_Reset();
	Lcd_Init();
    while(1)
    {
			for(i=0;i<7;i++)
			{
				plcd=(struct lcd_all_line*)(p[i]);
				display(plcd);
			}
								for(i=0;i<7;i++)
			{
				plcd=(struct lcd_all_line*)(p[6-i]);
				display(plcd);
			}	
	
			//	display(gImage_2);
				//display(gImage_3);
//        HAL_GPIO_WritePin(GPIOB,GPIO_PIN_1,GPIO_PIN_RESET); //LED0对应引脚PB1拉低，亮，等同于LED0(0)
//        HAL_GPIO_WritePin(GPIOB,GPIO_PIN_0,GPIO_PIN_SET);   //LED1对应引脚PB0拉高，灭，等同于LED1(1)
//        delay_ms(500);										//延时500ms
//        HAL_GPIO_WritePin(GPIOB,GPIO_PIN_1,GPIO_PIN_SET);   //LED0对应引脚PB1拉高，灭，等同于LED0(1)
//        HAL_GPIO_WritePin(GPIOB,GPIO_PIN_0,GPIO_PIN_RESET); //LED1对应引脚PB0拉低，亮，等同于LED1(0)
//        delay_ms(500);                                      //延时500ms 
    }
}
 

 
